function pagination(param, page = 1) {

    let noPage = 100;

    if(param.select) {
        if(param.select === 'create') {
            return `select * from ${param.elementType} ${iml.if(param.query, 'where ' + param.query + ' ', '')}order by createdtime desc limit ${(page - 1) * noPage}, ${noPage};`;
        }
        else if(param.select === 'modify') {
            return `select * from ${param.elementType} ${iml.if(param.query, 'where ' + param.query + ' ', '')}order by modifiedtime desc limit ${(page - 1) * noPage}, ${noPage};`;
        }
    }

    return `select * from ${param.elementType} ${iml.if(param.query, 'where ' + param.query + ' ', '')}limit ${(page - 1) * noPage}, ${noPage};`;

}

