function buildFields(items, user_id, update, module, loadDefault) {
	let outputArray = [];
	let customFieldsArray = [];

	items.filter(field => field.type.name !== 'autogenerated').filter(field => iml.if(module.name === 'Tax' && !module.isEntity, field.name === 'taxlabel' || field.name === 'percentage', field.editable)).forEach(field => {
		if (field.label === "") return;
		let obj = {};
		obj.name = field.name;
		obj.label = field.label.replace (/&amp;/g, "&");
		if (loadDefault === 'yes' && field.default) {
			obj.default = field.default;
		}
		if (!update) {
			if(field.mandatory) obj.required = field.mandatory;
			else obj.advanced = true;
		}

		switch (field.type.name) {
			case "string":
				if (field.name === 'fremailtemplateid') {
					obj.type = 'hidden';
					obj.required = false;
					obj.default = "0";
					break;
				}
			case "text":
			case "estimate":
			case "url":
			case "phone":
			case "richtext":
			case "image":
			case "multicurrency":
				obj.type = "text";
				break;
			case "time":
				obj.type = "text";
				obj.help = "Format:`HH:mm:ss`\ne.g.`13:30:00`"
				break;
			case "email":
				obj.type = "email";
				break;
			case "integer":
				if (field.type.length === '1') {
					obj.help = 'True =`1`\nFalse =`0`';
				}
				if (field.name === 'parentfolder' && module.name === 'DocumentFolders') return;
				else if (field.name === "operational_hours" && module.name === 'SLA') {
					obj.type = "select";
					obj.options = iml.operationHours();
				}
				else {
					obj.type = "integer";
				}
				break;

			case "double":
			case "percentage":
				obj.type = "number";
				break;
			case "metricpicklist":
			case "multipicklist":
			case "picklist":
				obj.type = "select";
				if (field.type.picklistValues.length === 0 && field.name === "related_modulename") {
					obj.options = "rpc://listElementTypes";
					obj.grouped = true;
				}
				else {
					obj.options = field.type.picklistValues.map(key => {
						let option = {};
						option.value = key.value;
						option.label = key.label;
						return option;
					});
				}
				if(field.type.name === 'multipicklist') obj.multiple = true;
				break;
			case "date":
			case "datetime":
				obj.type = "date";
				break;
			case "reference":
				if (iml.length(field.type.refersTo) === 0) {
					obj.type = "text";
				}
				else {
					if (iml.length(field.type.refersTo) > 1) {
						let options = field.type.refersTo.map(item => {
							let option = {};
							option.lable = item;
							option.value = item;
							return option;
						});
						obj.type = 'text';
						obj.rpc = {
							label: "Search",
							url: "rpc://listReferences?value=",
							parameters: [
								{
									name: "value",
									label: "Type",
									required: true,
									type: "select",
									options: options
								}
							]
						};
					}
					else if (field.name === 'parent_comments' && field.type.refersTo[0] === 'ModComments') {
						obj.label = field.label + ' (Comment)'
						obj.type = "select";
						obj.options = "rpc://listReferences?value=" + field.type.refersTo[0];
					}
					else {
						obj.type = "select";
						obj.options = "rpc://listReferences?value=" + field.type.refersTo[0];
					}
				}
				break;
			case "boolean":
				obj.type = "boolean";
				break;
			case "owner":
				obj.type = "select";
				obj.options = "rpc://listAssignees";
				obj.mode = "edit";
				obj.grouped = true;
				obj.default = iml.if(update, undefined, user_id);
				break;
			case "coowner":
				obj.type = "select";
				obj.options = "rpc://listAssignees";
				obj.mode = "edit";
				obj.grouped = true;
				obj.default = iml.if(update, undefined, user_id);
				break;
			case "file":
				obj.type = "text";
				break;
			case "currency":
				obj.type = 'number';
				break;
			default:
				return;
			}
		if (obj.name.startsWith('cf_')) {
			if (!update && field.mandatory) {
				customFieldsArray.unshift(obj);
			} else {
				customFieldsArray.push(obj);
			}
		}
		else {
			if (!update && field.mandatory) {
				outputArray.unshift(obj);
			} else {
				outputArray.push(obj);
			}
		}
	});


	if(module.name === 'SalesOrder' || module.name === 'Quotes' || module.name === 'Invoice') {
		let lineItems = {
			name : 'LineItems',
			label : 'Line Items',
			type : 'array',
			required : iml.if(update, false, true),
			spec: iml.lineItemArrayParameters()
		}
		outputArray.unshift(lineItems);
	}

	outputArray = outputArray.sort((a,b) => a.label.localeCompare(b.label));
	customFieldsArray = customFieldsArray.sort((a,b) => a.label.localeCompare(b.label));

	if (customFieldsArray.length === 0) return [
		{
			name: "fields",
			label: "Fields",
			type: "collection",
			spec: outputArray
		}
	];

	else return [
		{
			name: "fields",
			label: "Fields",
			type: "collection",
			spec: outputArray
		},
		{
			name: "custom_fields",
			label: "Custom Fields",
			type: "collection",
			spec: customFieldsArray
		}
	];
}

