function queryString(param, page = 1, select) {

	let noPage = 100;

	let type = param.elementType;

	let filter = param.filter;

	if (!filter) {
		if (select) {
			if (select === 'create') {
				return `select * from ${type} order by createdtime desc limit ${(page - 1) * noPage}, ${noPage};`;
			}
			else if (select === 'modify') {
				return `select * from ${type} order by modifiedtime desc limit ${(page - 1) * noPage}, ${noPage};`;
			}
		}
		return `select * from ${type} limit ${(page - 1) * noPage}, ${noPage};`;
	}

	let conditions = filter.map(or => {
		return or.map(and => {
			if (!(and.a) || !(and.b) || !(and.o)) return;

			let text = '';
			switch (and.o) {
				case 'text_equals':
					text = `${and.a} = '${and.b}'`;
					break;
				case 'text_not_equals':
					text = `${and.a} != '${and.b}'`;
					break;
				case 'text_startswith':
					text = `${and.a} LIKE '${and.b}%'`;
					break;
				case 'text_endswith':
					text = `${and.a} LIKE '%${and.b}'`;
					break;
				case 'text_contains':
					text = `${and.a} LIKE '%${and.b}%'`;
					break;
				case 'number_equals':
					text = `${and.a} = ${and.b}`;
					break;
				case 'number_not_equals':
					text = `${and.a} != ${and.b}`;
					break;
				case 'number_less_than':
					text = `${and.a} < ${and.b}`;
					break;
				case 'number_less_than_or_equals':
					text = `${and.a} <= ${and.b}`;
					break;
				case 'number_greater_than':
					text = `${and.a} > ${and.b}`;
					break;
				case 'number_greater_than_or_equals':
					text = `${and.a} >= ${and.b}`;
					break;
				case 'date_equals':
					text = `${and.a} = '${iml.formatDate(iml.parseDate(and.b), 'YYYY-MM-DD HH:mm:ss')}'`;
					break;
