function lineItemFields(fields, loadDefault) {

	if (!fields) return;

	else if (!Array.isArray(fields) && typeof fields === 'object') {
		fields = Object.values(fields);
	}

	let arr = [];

	fields.forEach(field => {
		if (field.label === "") return;
		let obj = {};
		obj.name = field.name;
		obj.label = field.label;
		if (loadDefault === 'yes' && field.default) {
			obj.default = field.default;
		}
		switch (field.type.name) {
			case "string":
				if (field.name === 'fremailtemplateid') {
					obj.type = 'hidden';
					obj.required = false;
					obj.default = "0";
					break;
				}
			case "text":
			case "estimate":
			case "url":
			case "phone":
			case "richtext":
			case "image":
			case "multicurrency":
				obj.type = "text";
				break;
			case "time":
				obj.type = "text";
				obj.help = "Format:`HH:mm:ss`\ne.g.`13:30:00`"
				break;
			case "email":
				obj.type = "email";
				break;
			case "integer":
				if (field.type.length === '1') {
					obj.help = 'True =`1`\nFalse =`0`';
				}
				if (field.name === 'parentfolder' && module.name === 'DocumentFolders') return;
				else if (field.name === "operational_hours" && module.name === 'SLA') {
					obj.type = "select";
					obj.options = iml.operationHours();
				}
				else {
					obj.type = "integer";
				}
				break;

			case "double":
			case "percentage":
				obj.type = "number";
				break;
			case "metricpicklist":
			case "picklist":
				obj.type = "select";
				if (field.type.picklistValues.length === 0 && field.name === "related_modulename") {
					obj.options = "rpc://listElementTypes";
					obj.grouped = true;
				}
				else {
					obj.options = field.type.picklistValues.map(key => {
						let option = {};
						option.value = key.value;
						option.label = key.label;
						return option;
					});
				}
				break;
			case "date":
			case "datetime":
				obj.type = "date";
				break;
			case "reference":
				if (iml.length(field.type.refersTo) === 0) {
					obj.type = "text";
				}
				else {
					if (iml.length(field.type.refersTo) > 1) {
						let options = field.type.refersTo.map(item => {
							let option = {};
							option.lable = item;
							option.value = item;
							return option;
						});
						obj.type = 'text';
						obj.rpc = {
							label: "Search",
							url: "rpc://listReferences?value=",
							parameters: [
								{
									name: "value",
									label: "Type",
									required: true,
									type: "select",
									options: options
								}
							]
						};
					}
					else if (field.name === 'parent_comments' && field.type.refersTo[0] === 'ModComments') {
						obj.label = field.label + ' (Comment)'
						obj.type = "select";
						obj.options = "rpc://listReferences?value=" + field.type.refersTo[0];
					}
					else {
						obj.type = "select";
						obj.options = "rpc://listReferences?value=" + field.type.refersTo[0];
					}
				}
				break;
			case "boolean":
				obj.type = "boolean";
				break;
			case "owner":
				obj.type = "select";
				obj.options = "rpc://listAssignees";
				obj.mode = "edit";
				obj.grouped = true;
				obj.default = user_id;
				break;
			case "coowner":
				obj.type = "select";
				obj.options = "rpc://listAssignees";
				obj.mode = "edit";
				obj.grouped = true;
				obj.default = user_id;
				break;
			case "file":
				obj.type = "text";
				break;
			case "currency":
				obj.type = 'number';
				if(loadDefault === 'yes' && field.default) {
					obj.default = '21x' + field.default;
				}
				break;
			default:
				return;
		}
		if (field.mandatory) {
			arr.unshift(obj);
		} else {
			arr.push(obj);
		}
	});

	return arr;

}

