    switch (elementType) {
        case "Calendar":
            return item.subject;
        case "Accounts":
            return item.accountname;

        case "Contacts":
            return item.firstname + iml.if(item.lastname, ' ' + item.lastname, '') + iml.if(item.email, ' <' + item.email + '>', '');

        case "Products":
            return item.productname;

        case "Documents":
            return item.notes_title;

        case "Emails":
            return item.subject;

        case "Faq":
            return item.question;

        case "Events":
            return item.subject;

        case "Users":
            return item.user_name;

        case "ServiceContracts":
            return item.subject;

        case "Services":
            return item.servicename;

        case "Assets":
            return item.assetname;

        case "ModComments":
            return item.commentcontent;

        case "SLA":
            return item.policy_name;

        case "Cases":
            return item.title;

        case "Olark":
            return 'Olark No.' + item.olarkno;

        case "PrintTemplates":
            return item.name;

        case "Inbox":
            return item.subject;

        case "JourneyTemplates":
            return item.name;

        case "Emotions":
            return iml.if(item.emotion, item.emotion + ' related to ', 'Emotion related to ') + item.related_to;

        case "EmailSequence":
            return item.name;

        case "PhoneCalls":
            return item.direction;

        case "SMSNotifier":
            return item.message;

        case "Import":
            return item.name;

        case "Groups":
            return item.groupname + iml.if(item.groupemail, ' <' + item.groupemail + '>', '');

        case "Currency":
            return item.currency_name + iml.if(item.currency_symbol, ' (' + item.currency_symbol + ')', '');

        case "DocumentFolders":
            return item.foldername;

        case "CompanyDetails":
            return item.organizationname;

        case "LineItem":
            return iml.substring(item.comment, 0, 40) + '...';

        case "Tax":
            return item.taxname;

        case "ProductTaxes":
            return item.taxid + iml.if(item.taxpercentage, ' ' + item.taxpercentage + '%', '') + iml.if(item.regions, ' in ' + item.regions, '');

        case "Roles":
            return item.rolename;

        default:
            return;

    }

}

