function RpcListObjectsforGroup(body, elementType) {

	if(!body) return;

	if(typeof body === 'object' && !(Array.isArray(body))) {
		body = Object.values(body);
	}

	let arr = [];

	body.forEach(item => {

		let obj = {};

		obj.value = item.id;

		switch (elementType) {
			case "Groups":
				obj.label = item.groupname; //+ iml.if(item.groupemail, ' <' + item.groupemail + '>', '');
				break;

			default:
				break;
		}

		arr.push(obj);

	});

	arr = arr.sort(function(a,b) {
        if(a.label < b.label) return -1;
        if(a.label > b.label) return 1;
        return 0;
    });

	return arr;

}

